webpackJsonp([0xc7c4445ecbdb],{246:function(t,n){t.exports={data:{site:{siteMetadata:{title:":-)",author:"github.com/9renpoto"}},markdownRemark:{id:"/home/travis/build/9renpoto/entry/src/pages/2012-09-13-python-install/index.md absPath of file >>> MarkdownRemark",html:'<h1>first Python</h1>\n<p>Pyconに参加しようと思ったんですが、Python素人のボクはまず環境構築から。</p>\n<h2>Pythonのversion管理</h2>\n<p>Pythonはpythonbrew+virtualenvで環境を作るのが良いらしいので、言われるがままに環境作ってみます。</p>\n<h2>pythonbrewの環境構築</h2>\n<html><head></head><body><div class="gatsby-highlight">\n      <pre class="language-sh"><code>curl -kLO https://github.com/utahta/pythonbrew/raw/master/pythonbrew-install\nchmod +x pythonbrew-install\n./pythonbrew-install</code></pre>\n      </div></body></html>\n<p>pythonbrewの環境変数を通す\nzshの場合でも以下の内容を書くらしい。</p>\n<html><head></head><body><div class="gatsby-highlight">\n      <pre class="language-sh"><code>[[ -s $HOME/.pythonbrew/etc/bashrc ]] &amp;&amp; source $HOME/.pythonbrew/etc/bashrc\n\npythonbrew list -k # &#x30A4;&#x30F3;&#x30B9;&#x30C8;&#x30FC;&#x30EB;&#x3067;&#x304D;&#x308B;version&#x78BA;&#x8A8D;\npythonbrew update # pythonbrew&#x306E;update</code></pre>\n      </div></body></html>\n<p>2系と3系の環境構築。</p>\n<html><head></head><body><div class="gatsby-highlight">\n      <pre class="language-sh"><code>pythonbrew install 2.7.2\npythonbrew switch 2.7.2\n\npythonbrew install 3.2\npythonbrew switch 3.2</code></pre>\n      </div></body></html>\n<p>virtualenvの環境はまた今度する。</p>',frontmatter:{title:"python install",date:"September 13, 2012"}}},pathContext:{path:"/entry/2012/09/13/python-install/"}}}});
